description:
GroupDocs.Metadata for .NET is a full featured class library which allows you to edit metadata associated with various document formats like PDF, DOC, DOCX, PPT, PPTX, VSD, VSDX, many image formats. This library helps to read and edit Audio metadata, manage Video metadata. It supports
archive formats. This metadata library allows to work with metadata standards like XMP, EXIF, IPTC.

Features:

  * Work with most popular metadata standards: XMP, EXIF, IPTC, Image Resource Blocks, ID3, document properties;
  * Create, modify and remove metadata associated with supported document and image formats with a few lines of code;
  * Manage EXIF metadata in Jpeg and TIFF formats;
  * Manage XMP metadata in image and PDF formats;
  * Manage Image Resource blocks in image formats;
  * Manage audio metadata: ID3 tag (ID3v1, ID3v2), Lyrics3 tag, APE;
  * Utilities to inspect and clean hidden metadata in document formats;
  * Utilities to Search and Compare all metadata;
  * Utilities to Export metadata to Excel/Csv;
  * Metadata cleanup utility;
  * MIME type detection;
  * Read track changes. Accept or reject track changes;
  * Read EXIF maker-notes: Sony, Nikon, Canon, Panasonic;
  * Export to CSV or XLS file.

Supported document formats:

  * Microsoft Word documents - DOC, DOT, DOCX, DOCM, DOTX, DOTM, RTF;
  * Microsoft Excel spreadsheets - XLS, XLT, XLSB, XLSX, XLSM, XLTX, XLTM;
  * Microsoft PowerPoint presentations - PPT, PPS, POT, PPTX, PPTM, POTX, POTM, PPSX, PPSM;
  * Microsoft Visio diagrams - VSD, VSS, VDX, VSX, VTX, VSDX;
  * Microsoft Project - MPP, MPT;
  * Microsoft OneNote - ONE;
  * Open Document formats - ODP, ODS, ODT;
  * Portable Document Formats - PDF, AI, AIT;
  * AutoCAD - DWG, DXF;
  * Email - EML, MSG;
  * Image - BMP, DIB, DCM, DC3, DIC, DICM, DJVU, DJV, GIF, J2C, J2K, JPC, JP2, JPF, JPM, JPX, JPEG, JPG, JPE, PNG, JNG, MNG, PSD, PSB, PSDT, TIFF, TIF, WEBP, EMF, WMF;
  * Audio - MP3, WAV;
  * Video - ASF, AVI, FLV, MKA, MKV, MKS, MOV, QT, WEBM;
  * Ebook - EPUB, FB2, CHM;
  * Fonts - OTF, TTF, TTC;
  * Other formats - TORRENT, VCF, VCARD;
  * Archive - ZIP.

For more details on the GroupDocs.Metadata for .NET API, please visit GroupDocs website at:
https://products.groupdocs.com/metadata/net

Note: GroupDocs.Metadata for .NET will run in evaluation mode. In order to test full features of the product, please request a free 30-day temporary license.
